
    function estudar() {
        var ax_media = ipt_gols.value / ipt_partidas.value;
        if (ax_media > 0.6) {
            div_msg.innerHTML = `Atacante de futuro <br><br>
            <img src = "data:image/jpeg;base64,">`;
        } else if (ax_media < 0.2) {
            div_msg.innerHTML = `Melhor mudar de posição <br><br>
            <img src = "data:image/jpeg;base64,">`;
        } else {
            div_msg.innerHTML = `Atacante Mediano <br><br>
            <img src = "data:image/jpeg;base64,">`;
        }
        div_msg.innerHTML += `<br><br>Sua média de gols/partida é de ${ax_media}`;
    }
